def prefixesDivBy5(nums) :
    number = 0
    length = len(nums)
    divisible_list = []
    def convert_to_denary(numb):
        string_num = reversed(str(numb))
        denary_form = 0
        for i, letter in enumerate(string_num):
            denary_form += (int(letter) * (2 ** i))
        return denary_form
    for index, num in enumerate(nums):
        number += (num  * (10 **(length - index - 1)))
        check_num = number // (10 ** (length - index - 1))
        if convert_to_denary(check_num) % 5 == 0:
            divisible_list.append(True)
        else:
            divisible_list.append(False)

    return divisible_list


